webpackJsonp([36174353065274],{596:function(A,e){A.exports={data:{markdownRemark:{html:"<p>Ingfrid Breie Nyhus (f 1978) spiller folkemusikk, klassisk og samtidsmusikk på piano.</p>\n<p>Hun vokste opp i en folkemusikkfamilie, først og fremst med polstradisjonen fra far Sven Nyhus. Hun gjorde klassiske klaverstudier i Norge, Finland og Tyskland, og har siden arbeidet med klassisk og kontemporær solo- og kammermusikk, deriblant mange komponistsamarbeider og urfremføringer.</p>\n<p>Kritikerne beskrev henne tidlig som “en klangvirtuos”, med “saftig anslag og rike nyanser”, blant den nye generasjonen pianister “som virkelig har noe på hjertet”.</p>\n<p>Hun har mottatt en rekke priser for sine fremførelser og innspillinger, som den Norske Solistpris i 2005. Innspillingen ‘Griegslåttene op.72’ ble nominert til Spellemannprisen innen klassisk musikk, og utnevnt til “Record of the year” av Great Britain Grieg Society i 2007. Platen “Hardanger Fiddle in Art Music” ble nominert til Spellemannsprisen i klassisk musikk 2016, og platen “Slåttepiano” ble nominert til Folkelarmprisen 2016.</p>\n<p>Hun har gjestet festivaler og konsertserier som Festspillene i Bergen, Risør Kammermusikkfest, Ultima-Festivalen, Nordlysfestivalen, Vestfoldfestspillene, Ilios-festivalen, Grønland Kammermusikkfestival, Avgarde, Beberseen Soireen, Schwetzinger Festspiele, Sandvika Master Series, Festspillene i Nord-Norge, Horten Kammermusikkfest, m.m, og hun har vært solist med orkestre som Oslo-Filharmonien, Kringkastingsorkesteret, Trondheimsolistene, Trondheim Symfoniorkester, Kristiansand Symfoniorkester.</p>\n<p>Ingfrid Breie Nyhus har vært stipendiat i kunstnerisk forskning ved Norges musikkhøgskole/Program for kunstnerisk utviklingsarbeid, med prosjektet “Tradisjoner på spill, mellom slåtter og pianisme”. Hun har vært kunstnerisk leder for kammermusikkfestivalen Vinterfestspill i Bergstaden 2015-2017, og hun driver plateselskapet LabLabel.</p>\n<p>Foto: Geir Dokken.</p>",timeToRead:1,excerpt:"Ingfrid Breie Nyhus (f 1978) spiller folkemusikk, klassisk og samtidsmusikk på piano. Hun vokste opp i en folkemusikkfamilie, først og…",id:"/Users/thomasheimstad/Sites/Obo/src/posts/artister/ingfrid-breie-nyhus.md absPath of file >>> MarkdownRemark",frontmatter:{workname:null,composedin:null,startDate:null,startTime:null,location:null,artists:null,medialink:null,title:"Ingfrid Breie Nyhus",dedicatedTo:null,author:null,date:"2018-05-07T12:00:00.048Z",category:"artister",tags:["pianist"],thumbnail:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:2.0089285714285716,src:"/static/IngfridBreieNyhus-fe53360f66ceaf8855f41026162f7fb1-75441.jpg",srcSet:"/static/IngfridBreieNyhus-fe53360f66ceaf8855f41026162f7fb1-75441.jpg 450w",sizes:"(max-width: 450px) 100vw, 450px"}}}},fields:{slug:"/artister/ingfrid-breie-nyhus/",artist:null,opuses:[{frontmatter:{title:"66",category:"opus",workname:"19 norske folkeviser",thumbnail:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1,src:"/static/opus66-6b3a06d75bbb2951bb82a66f2dc7f3cb-466fa.jpg",srcSet:"/static/opus66-6b3a06d75bbb2951bb82a66f2dc7f3cb-27b23.jpg 90w,\n/static/opus66-6b3a06d75bbb2951bb82a66f2dc7f3cb-0afbd.jpg 180w,\n/static/opus66-6b3a06d75bbb2951bb82a66f2dc7f3cb-466fa.jpg 360w,\n/static/opus66-6b3a06d75bbb2951bb82a66f2dc7f3cb-43088.jpg 540w,\n/static/opus66-6b3a06d75bbb2951bb82a66f2dc7f3cb-545bd.jpg 720w,\n/static/opus66-6b3a06d75bbb2951bb82a66f2dc7f3cb-8c1c4.jpg 1080w,\n/static/opus66-6b3a06d75bbb2951bb82a66f2dc7f3cb-1e671.jpg 3887w",sizes:"(max-width: 360px) 100vw, 360px"}}}},fields:{slug:"/opus66/",artist:[{frontmatter:{title:"Ingfrid Breie Nyhus",tags:["pianist"]}}]}}]}}},pathContext:{slug:"/artister/ingfrid-breie-nyhus/"}}}});
